      <li>\u0417\u0430\u0433\u0440\u0443\u0437\u043A\u0430 \u0438\u0437\u043E\u0431\u0440\u0430\u0436\u0435\u043D\u0438\u0439 \u0438 \u0437\u0432\u0443\u043A\u043E\u0432 \u0432 \u0438\u0433\u0440\u0443</li>
